import React, {Component} from 'react';
import Config from "../scripts/config";
import {Form,Range, Input, Row,Col, Container, Button} from "react-bootstrap";

class Rossrv extends Component {
  state = {ros: null};

  constructor(){
    super();

      }
  // create a pose subscriber
  init_connection(){
    console.log("Establish map connection");

      try{
        this.state.ros = new window.ROSLIB.Ros();
        this.state.ros.connect(
          "ws://"+Config.ROSBRIDGE_SERVER_IP+":"+Config.RSOBRIDGE_PORT+""
        );
        console.log("In map components");
      }catch(error) {
        console.log("Connection problem in map components");
      }
    }

 componentDidMount(){
      this.init_connection();
    }





  render (){
    return(
      <form>
        <fieldset>
          <fieldset class="form-group">
            <legend class="mt-4">Ranges</legend>
              <label for="customRange1" class="form-label">Example range</label>
              <input type="range" class="form-range" id="customRange1"/>
              <label for="disabledRange" class="form-label">Disabled range</label>
              <input type="range" class="form-range" id="disabledRange" />
              <label for="customRange3" class="form-label">Example range</label>
              <input type="range" class="form-range" min="0" max="5" step="0.5" id="customRange3"/>
          </fieldset>
          <button type="submit" class="btn btn-primary">Submit</button>
        </fieldset>
      </form>
      );
  }
}
export default Rossrv;
